package com.yl.common.util;

import java.io.File;
import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.OutputStream;
import sun.misc.BASE64Decoder;
import sun.misc.BASE64Encoder;

public class ImgUtil {
	/**
	 * 图片转Base64(待处理)
	 * @return
	 */
	public static String GetImageStr() {// 将图片文件转化为字节数组字符串，并对其进行Base64编码处理
		String imgFile = "D:\\tupian\\20181207085101.jpg";// 待处理的图片
		InputStream in = null;
		byte[] data = null;
		// 读取图片字节数组
		try {
			in = new FileInputStream(imgFile);
			data = new byte[in.available()];
			in.read(data);
			in.close();
		} catch (IOException e) {
			e.printStackTrace();
		}
		// 对字节数组Base64编码
		BASE64Encoder encoder = new BASE64Encoder();
		return encoder.encode(data);// 返回Base64编码过的字节数组字符串
	}

	/**
	 * base64转为图片存储
	 * @param imgStr
	 * @return
	 * @throws IOException 
	 */
	public static boolean BaseToImage(String imgStr, String path) throws IOException {
		if (imgStr == null) // 图像数据为空
			return false;
		BASE64Decoder decoder = new BASE64Decoder();
		// Base64解码
		String codeStr = imgStr.substring(imgStr.indexOf("base64,") + "base64,".length());
		byte[] b = decoder.decodeBuffer(codeStr);
		for (int i = 0; i < b.length; ++i) {
			if (b[i] < 0) {// 调整异常数据
				b[i] += 256;
			}
		}
		//String imgFilePath = "D:\\tupian\\new.jpg";// 新生成的图片
		String imgPath = path.substring(0, path.lastIndexOf("/"));
		File dirPath = new File(imgPath);
        if(!dirPath.exists()){
        	dirPath.mkdirs();
        }
        
		OutputStream out = new FileOutputStream(path);
		out.write(b);
		out.flush();
		out.close();
		return true;
	}

	public static void main(String[] args) throws IOException {
		//System.out.print(GetImageStr());
		String str = "data:image/png;base64,";
		String path = "D:\\tupian\\new.png";
		BaseToImage(str, path);
	}
}